import types from "./../types/typeOfActions";
const initialState = [];
const chatReducer = (state = initialState, action) => {
  switch (action.type) {
    case types.GET_CHAT:
        let {payload} = act
      return [...state];

    default:
      return [...state];
  }
};
export default chatReducer;
